import React from 'react';
import {connect} from 'react-redux';
import {initialStateTypes, Logout} from '../../redux/reducers/AuthReducer';
import { Home } from './Home';
import {GetSearchedData} from "../../redux/reducers/ProfileReducer";
import {Redirect} from "react-router";
type PropsType =
    {
    profiles:  Array<{
        id: number,
        companyProfilePicture: string,
        companyName: string,
        companyDescription: string,
        country: string,
        companyLogo: string,
        sections: string,
        owner: number
    }>,
    Logout: () => void,
    GetSearchedData: (search: string) => Array<string>,
    isAuthenticated: boolean | null
}
class HomeContainer extends React.Component<PropsType> {
    render() {
    debugger
        return this.props.profiles.length !== 0 ? <Redirect to={"/manufacturers"}/> : (
            <Home logout = {this.props.Logout}  GetSearchedData = {this.props.GetSearchedData} isAuthenticated = {this.props.isAuthenticated} />
        )
    }
}
let mapStateToProps = (state: any) =>{
    return {
        isAuthenticated: state.auth.isAuthenticated,
        profiles: state.profile.profiles,
    }
   }
export default connect(mapStateToProps, {Logout, GetSearchedData})(HomeContainer)
